// In this example we store an atomic value on the tide webserver
// it is controlled by requests from the clients
//
use tide::Request;
use tide::prelude::*;
use std::sync::{Arc};
use std::sync::atomic::{AtomicI32, Ordering};

// the counter can be +ve or -ve so its an integer 32
#[derive(Clone)]
struct State {
    value: Arc<AtomicI32>,
}

impl State {
    fn new() -> Self {
        Self {
            value: Arc::new(AtomicI32::new(0)),
        }
    }
}

// we define value to add/set sent from the client can only be positive as a u16 
#[derive(Debug, Deserialize)]
struct QueryObj {
    value: Option<u16>,
    set_by: String,
}

impl QueryObj {
    /// Create a new QueryObj.
    fn new(value: Option<u16>, set_by: &str) -> QueryObj {
        QueryObj { value: value, set_by: set_by.to_string() }
    }
    fn get_id(&self) -> &str {
        &self.set_by
    }
    fn get_val(&self) -> i32 {
        self.value.unwrap_or(0) as i32
    }
}

#[async_std::main]
async fn main() -> tide::Result<()> {
    let mut app = tide::with_state(State::new());
    app.with(tide::log::LogMiddleware::new());
    // curl -i 'localhost:8080/add
    // returns the saved atomic value to the client
    //
    app.at("/").get(|req: tide::Request<State>| async move {
        let state = req.state();
        let value = state.value.load(Ordering::Relaxed);
        Ok(format!("{}\n", value))
    });
    // curl -i 'localhost:8080/add
    // increments the atomic value
    //
    app.at("/inc").get(|req: tide::Request<State>| async move {
        let state = req.state();
        let value = state.value.fetch_add(1, Ordering::Relaxed) + 1;
        Ok(format!("{}\n", value))
    });
    // curl -i 'localhost:8080/sub
    // subtracts from the atomic value
    //
    app.at("/sub").get(|req: tide::Request<State>| async move {
        let state = req.state();
        let value = state.value.fetch_sub(1, Ordering::Relaxed) - 1;
        Ok(format!("{}\n", value))
    });
    // curl -i 'localhost:8080/add?value=100&set_by=charlie'
    // adds to the atomic memory value to what is specified in the curl
    //
    app.at("/add").get(|req: Request<State>| {
        async move {
           let client_data = req.query::<QueryObj>().unwrap();
           let state = req.state();
           let value = state.value.fetch_add(client_data.get_val(),Ordering::Relaxed) + 1;
           Ok(tide::Response::builder(200)
               .body(format!("<html><h2>New Value set to {} by user {}!</h2></html>",
                client_data.get_val(), client_data.get_id()))
               .header("Server", "tide")
               .content_type(tide::http::mime::HTML)
               .build())
        }
    });
    // curl -i 'localhost:8080/reset
    // sets the atomic memory value to zero
    //
    app.at("/reset").get(|req: tide::Request<State>| async move {
        let state = req.state();
        let value = state.value.load(Ordering::Relaxed);
        let value = state.value.fetch_sub(value, Ordering::Relaxed);			
        Ok(format!("{}\n", value))
    });
    // curl -i 'localhost:8080/set?value=900&set_by=rocksy'
    // sets the atomic memory value to what is specified in the curl
    //
    app.at("/set").get(|req: Request<State>| {
        async move {
           let client_data = req.query::<QueryObj>().unwrap();
           let state = req.state();
           let value = state.value.load(Ordering::Relaxed);
           if value > 0 {
                let value = state.value.fetch_sub(value, Ordering::Relaxed);
           } else {
                let value = state.value.fetch_add(value, Ordering::Relaxed);
           }           
           let value = state.value.fetch_add(client_data.get_val(),Ordering::Relaxed) + 1;
           Ok(tide::Response::builder(200)
               .body(format!("<html><h2>New Value set to {} by user {}!</h2></html>",
                client_data.get_val(), client_data.get_id()))
               .header("Server", "tide")
               .content_type(tide::http::mime::HTML)
               .build())
        }
    });
    app.listen("127.0.0.1:8080").await?;
    Ok(())
}

vector<double> dist2(n+1, double_inf);
vector<int> prev(n+1, -1);
vector<bool> visited(n+1, false);
prev[1] = -1;

dist2[1]=0;

for(int i=1; i<=n; ++i){
     int vertex=-1;
     for(int j=1; j<=n; ++j)
         if(!visited[j] &&(vertex==-1 || dist2[j] < dist2[vertex])) 
         vertex = j;
         
     if(vertex==-1 || dist2[vertex]==double_inf)
         break;
         
     visited[vertex] = true;
     
     for(int j=1; j<=n; ++j){
         if(vertex == j)
             continue;
             
         int to = j;
         double len = dist[to][vertex];
         
         if(dist2[vertex]+len <dist2[to]){
              dist2[to] = dist2[vertex]  + len;
              prev[to] = vertex;
         }
     }
}

Задача
Написать конвертер валют (3 валюты).
У пользователя есть баланс в каждой из представленных валют. Он может попросить сконвертировать часть баланса с одной валюты в другую. Тогда у него с баланса одной валюты снимется X и зачислится на баланс другой Y. Курс конвертации должен быть просто прописан в программе.
По имени переменной курса конвертации должно быть понятно, из какой валюты в какую валюту конвертируется.
Должна выполняться однотипная операция или везде умножение "*" или деление "/". Для чего это нужно подробнее позже узнаете в разделе "Функции". Но придётся объявить коэффициенты на все случаи.
 
Программа должна завершиться тогда, когда это решит пользователь.
 
Дополнительно: Если решение строится на switch, то принято работать с константами (в остальных случаях объявляются переменные). Для каждого case следует объявить константу.
Пример:
const string CommandExit = "exit";
 
case CommandExit:
break;
 
Константы объявляются перед блоком переменных и отделяются от них пустой строкой. Константы именуются с большой буквы. Если константа создана для связки консольное меню + switch (case) к имени константы добавляется Command или Menu - это передает суть константы, превращая ее в существительное, а не глагол и улучшает читаемость кода.

