function deserializeString(arr) {
    let word = [];


    for (let line of arr) {
        if (line == 'end') {
            console.log((word).join(''));
            return;
        }

        let [letter, indexes] = line.split(':');
        let newIndexes = indexes.split('/').map(Number);


        for (let i = 0; i < Infinity; i++) {
            if (newIndexes.includes(i)) {
                word.splice(i, 0, letter);
                newIndexes.shift();
            }
            if (newIndexes.length == 0) {
                break;
            }
        }

    }

}

