#include <vector>
#include <mpi.h>

std::vector<double> Gauss(std::vector<double>& matrix, int size) {
    int rank, comm_size;
    MPI_Comm_rank(MPI_COMM_WORLD, &rank);
    MPI_Comm_size(MPI_COMM_WORLD, &comm_size);

    std::vector<double> Xi(size, 0.0);  // Инициализация вектора нулями

    int nrows = get_slice(size, comm_size, rank);
    std::vector<int> rows(nrows);
    std::vector<double> tmp(size + 1);

    for (int i = 0; i < nrows; i++)
        rows[i] = rank + comm_size * i;

    int row = 0;
    for (int i = 0; i < size - 1; i++) {
        if (i == rows[row]) {
            MPI_Bcast(tmp.data(), size + 1, MPI_DOUBLE, rank, MPI_COMM_WORLD);
            for (int j = 0; j <= size; j++)
                tmp[j] = matrix[rows[row] * (size + 1) + j];
            row++;
        } else {
            MPI_Bcast(tmp.data(), size + 1, MPI_DOUBLE, i % comm_size, MPI_COMM_WORLD);
        }

        for (int j = row; j < nrows; j++) {
            double scaling = matrix[rows[j] * (size + 1) + i] / tmp[i];
            for (int k = i; k < size + 1; k++)
                matrix[rows[j] * (size + 1) + k] -= scaling * tmp[k];
        }
    }

    row = 0;
    for (int i = 0; i < size; i++) {
        if (i == rows[row]) {
            Xi[i] = matrix[i * (size + 1) + size];
            row++;
        }
    }

    row = nrows - 1;
    for (int i = size - 1; i > 0; i--) {
        if (row >= 0) {
            if (i == rows[row]) {
                Xi[i] /= matrix[i * (size + 1) + i];
                MPI_Bcast(&(Xi.data())[i], 1, MPI_DOUBLE, rank, MPI_COMM_WORLD);
                row--;
            } else {
                MPI_Bcast(&(Xi.data())[i], 1, MPI_DOUBLE, i % comm_size, MPI_COMM_WORLD);
            }
        } else {
            MPI_Bcast(&(Xi.data())[i], 1, MPI_DOUBLE, i % comm_size, MPI_COMM_WORLD);
        }

        for (int j = 0; j <= row; j++)
            Xi[rows[j]] -= matrix[rows[j] * (size + 1) + i] * Xi[i];
    }

    if (rank == 0)
        Xi[0] /= matrix[rows[row] * (size + 1)];

    return Xi;
}

