class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      home: Padding(
        padding: EdgeInsets.all(32.0),
        child: SquareAnimation(),
      ),
    );
  }
}

class SquareAnimation extends StatefulWidget {
  const SquareAnimation({super.key});

  @override
  State<SquareAnimation> createState() {
    return SquareAnimationState();
  }
}

class SquareAnimationState extends State<SquareAnimation> {
  static const _squareSize = 50.0;
  var _align = Alignment.center;
  bool _animationInProgress = false;
  bool _leftPressed = false;
  bool _rightPressed = false;

  @override
  Widget build(BuildContext context) {
    return Column(
      children: [
        AnimatedAlign(
          alignment: _align,
          duration: const Duration(seconds: 1),
          onEnd: () {
            setState(() {
              _animationInProgress = false;
            });
          },
          child: Container(
            width: _squareSize,
            height: _squareSize,
            decoration: BoxDecoration(
              color: Colors.red,
              border: Border.all(),
            ),
         ),
        ),
        const SizedBox(height: 16),
        Row(
          children: [
            ElevatedButton(
              style: ElevatedButton.styleFrom(
                backgroundColor: (_leftPressed == true || _animationInProgress == true) ? Colors.grey : Colors.blue,
                onPrimary: Colors.white,
                onSurface: Colors.grey,
              ),
              onPressed:
                (_animationInProgress == true || _leftPressed == true ) ? null : () {
                    setState(() {
                      _align = Alignment.centerLeft;
                       _animationInProgress = true;
                      _leftPressed = true;
                      _rightPressed = false;
                    });
              },
              child: const Text('Left'),
            ),
            const SizedBox(width: 8),
            ElevatedButton(
              style: ElevatedButton.styleFrom(
                backgroundColor: (_rightPressed == true || _animationInProgress == true) ? Colors.grey : Colors.blue,
                onPrimary: Colors.white,
                onSurface: Colors.grey,
              ),
              onPressed:
                 (_animationInProgress == true || _rightPressed == true ) ? null : () {
                    setState(() {
                      _align = Alignment.centerRight;
                       _animationInProgress = true;
                      _rightPressed = true;
                      _leftPressed = false;
                    });
                 },
              child: const Text('Right'),
            ),
          ],
        ),
      ],
    );
  }
}

